sition.";i:12;s:133:"Some knowledge on how to repair garage door is essential in maintaining your garage since its door can be prone to a lot of problems.";i:13;s:61:"One of the most frequent is one that will not close properly.";i:14;s:105:"Though the malfunction can be caused by a lot of things a lot of them are also relatively easy to repair.";i:15;s:41:"Turn the screw one-half to one full turn.";i:16;s:68:"This may only move the door two or three inches closer to the floor.";i:17;s:80:"Climb down from the ladder and push the button on a remote or wall control unit.";i:18;s:98:"If you cant find any other reason that the door wont close check the alignment of the side tracks.";i:19;s:58:"One of them may be slanted toward the door and binding it.";i:20;s:99:"Your garage door will immediately stop and close if anything is in the field of view of the lenses.";i:21;s:66:"Its also a good idea to take a damp cloth and wipe off the lenses.";i:22;s:109:"Overtime spiderwebs dust and other filth can accumulate on the lenses causing the garage door to malfunction.";i:23;s:181:"The extension springs are evenly matched and installed to keep the garage door properly aligned so that it runs smoothly throughout the entire length of the track and closes evenly.";i:24;s:155:"If your door has a gap on one side or the other when its closed the problem is most likely due to a break or other issue with one of the extension springs.";i:25;s:58:"Repairing your garage door springs can be a dangerous job.";i:26;s:118:"If the garage door isnt closing fully theres a good chance the travel limit settings were changed for whatever reason.";i:27;s:137:"LiftMaster garage door opener troubleshooting guides which are part of the owners manual should have a solution for this sort of problem.";i:28;s:52:"Check the connected unit close the electric circuit.";i:29;s:84:"The OPEN force limit has been activated - the door has come to a halt while opening.";i:30;s:78:"If the door has come to a halt for no obvious reason check the door mechanics.";i:31;s:111:"When the door is in any position other than closed and the garage door opener is activated the door will close.";i:32;s:144:"If the garage door makes contact with an obstruction while closing the door will reverse the opener will beep and the lights will flash 5 times.";i:33;s:121:"Incorrect adjustment of garage door travel limits will interfere with the proper operation of the safety reversal system.";i:34;s:36:"Garage Door Doesnt Close Completely.";i:35;s:96:"If the garage door opens completely but will not close completely there are three common causes.";i:36;s:71:"Your garage door has switches that tell the motor when to stop running.";i:37;s:89:"The close-limit switch may need to be adjusted if it is preventing the door from closing.";i:38;s:71:"Are you having troubles with a garage door which simply will not close.";i:39;s:113:"Garage doors comprised many moving parts and a single faulty component can prevent your garage door from closing.";i:40;s:111:"Here are the most common garage door problems or breakdowns that will cause a malfunctioning door to not close.";i:41;s:37:"Broken cable or cable off the pulley.";i:42;s:105:"If the garage door opens correctly but fails to close completely there may be one of three common causes.";i:43;s:42:"The close-limit switch may need adjusting.";i:44;s:131:"Your garage door has set-limit switches that instruct the motor when to stop runningboth when it is opening and when it is closing.";i:45;s:115:"Doing this will force your garage door to close but like just mentioned this method only works with certain models.";i:46;s:132:"If your garage has a manual door meaning one thats opened and closed by hand and the garage door refuses to go down do not force it.";i:47;s:36:"This could cause unnecessary damage.";i:48;s:94:"If the garage door does not travel fully open or close there can be several different reasons.";i:49;s:109:"The symptom may be that it runs and opens 6-12 inches and stops or it runs to close 6-12 inches and reverses.";i:50;s:42:"Below are possible causes and resolutions.";i:51;s:59:"Correcting a garage door opener that fails to travel fully.";i:52;s:145:"Balancing a garage door is a job for a professional so make sure you call a local garage door pro to assist if youre experiencing balance issues.";i:53;s:35:"Adjust the Travel and Force Limits.";i:54;s:143:"If your balance looks good but your garage door will close but not open or open but not close its time to look at your travel and force limits.";}}